SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for points
-- ----------------------------
DROP TABLE IF EXISTS `points`;
CREATE TABLE `points`  (
  `pointId` int(6) NOT NULL AUTO_INCREMENT COMMENT '知识点的编号',
  `hintA` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '提示A，不可被隐藏，必须存在',
  `hintB` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '提示B，可被隐藏，对提示A的解释型文本，必须存在',
  `hintC` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '提示C，浮窗型文本，非必须',
  `studyDate` date NOT NULL COMMENT '知识点的背诵日期，由程序计算填入背诵日期，在对应日期查询即可',
  `stage` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '知识点的背诵阶段，由程序应用艾斯浩宾曲线给定，即一个阶段到下一个阶段的跳跃天数是算法给定，更改背诵日期实现',
  PRIMARY KEY (`pointId`) USING BTREE,
  INDEX `studyDateIndex`(`studyDate`) USING BTREE COMMENT '日期查询优化',
  INDEX `pointIdIndex`(`pointId`) USING BTREE COMMENT '知识点主键查询优化'
) ENGINE = InnoDB AUTO_INCREMENT = 19730 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '知识点表\r\n\r\n包括\r\nid	知识点编号\r\nclass_id	学科编号\r\nhint_a	主要内容，提示A，必须\r\nhint_b	次要内容，提示B，必须\r\nhint_c	补充内容，提示C，非必须\r\ndate	背诵日期\r\nstage	背诵阶段' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of points
-- ----------------------------

-- ----------------------------
-- Table structure for subject_points
-- ----------------------------
DROP TABLE IF EXISTS `subject_points`;
CREATE TABLE `subject_points`  (
  `subjectId` int(5) NOT NULL COMMENT '学科编号',
  `pointId` int(6) NOT NULL COMMENT '知识点编号',
  PRIMARY KEY (`pointId`, `subjectId`) USING BTREE,
  INDEX `subjectIdIndex`(`subjectId`) USING BTREE COMMENT '学科编号查询索引优化',
  CONSTRAINT `pointId` FOREIGN KEY (`pointId`) REFERENCES `points` (`pointId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `subjectId` FOREIGN KEY (`subjectId`) REFERENCES `subjects` (`subjectId`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '学科-知识点 链接表\r\n\r\nsubjectId\r\npointId' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of subject_points
-- ----------------------------

-- ----------------------------
-- Table structure for subjects
-- ----------------------------
DROP TABLE IF EXISTS `subjects`;
CREATE TABLE `subjects`  (
  `subjectId` int(5) NOT NULL AUTO_INCREMENT COMMENT '学科的编号',
  `subjectName` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '学科名字',
  PRIMARY KEY (`subjectId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 12 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

